import React from "react";

import "./orders-card.styles.css";

const OrdersCard = ({
  id,
  descriptionTitle,
  imageUrl,
  price,
  rating,
  quantity,
}) => {
  return (
    <div className="orderCard__container">
      <div className="orderCard__leftSide">
        <div>{descriptionTitle}</div>
        <img alt="" src={imageUrl}></img>
      </div>
      <div className="orderCard__rightSide">
        <div>{quantity}</div>
        <div>{price}</div>
      </div>
    </div>
  );
};

export default OrdersCard;
